import { createSlice } from "@reduxjs/toolkit";

const initialState = [
    { id: null , mean: null }
]

const meanSlice = createSlice({
    name:'mean', 
    initialState, 
    reducers: {
    }
})

export const selectAllmeans = (state) => state.means
export default meanSlice.reducer
